import React from "react";
import '../Css/Footer.css';

function Footer(){
    return(
        <footer classname="footer bg-dark text-light py-3">
            <div classname="container text-center">
                <div classname="row">
                    <div classname="col-12">
                        <p classname="footerText">&copy; 2024|  4 Wheel Barbers. All rights reserved.</p>
                        <a classname="footerLink" href="./terms*conditions">Terms & Conditions</a>
                        <Link classname="footerLink" to="/privacy_policy">Privacy Policy</Link>
                    </div>
                </div>
            </div>        
        </footer>
    )
}

export default Footer;
